const initialState = {
    inputtedQuestions: []
};

const questionReducer = (state = initialState, action) => {
    switch (action.type) {
        case "INPUT_QUESTION":
            console.log([...state.inputtedQuestions, action.payload]);
            return {
                // inputtedQuestions: [...state.inputtedQuestions, action.payload]
                inputtedQuestions: action.payload
            };
        default:
            return state;
    }
};

export default questionReducer;
